import React, { Component } from "react";
import "./NearSearch.scss";

class NearSearch extends Component {
  render() {
    const { isOpen } = this.props;
    return (
      <div className={`near-search-container ${isOpen ? "open" : ""}`}>
        {isOpen && (
          <div className="popup">
            <div className="popup-inner">
              <h1>Near Search Popup</h1>
              {/* Your popup content here, such as list of restaurants and map */}
              <button className="close-btn" onClick={this.props.togglePopup}>
                X
              </button>
            </div>
          </div>
        )}
      </div>
    );
  }
}

export default NearSearch;
